import React, { useEffect, useState } from 'react';
import AdminNav from '../AdminNavbar/AdminNav';
import DataTable from 'react-data-table-component';
import axios from 'axios';

function OwnerContacts() {
    const [ownerRecords, setOwnerRecords] = useState([]);
    const [loading, setLoading] = useState(true);
    const [columns, setColumns] = useState([]);

    useEffect(() => {
        axios.get('http://localhost:5000/owner-details')
            .then(response => {
                console.log('Owner Records:', response.data.owner_details);
                setOwnerRecords(response.data.owner_details);
                setLoading(false);
                
                // Generate columns based on the keys of the first object in ownerRecords
                if (response.data.owner_details.length > 0) {
                    const keys = Object.keys(response.data.owner_details[0]);
                    const generatedColumns = keys.map(key => ({
                        name: key,
                        selector: key,
                        sortable: true
                    }));
                    setColumns(generatedColumns);
                }
            })
            .catch(error => {
                console.error('Error fetching data:', error);
                setLoading(false);
            });
    }, []);

    return (
        <div>
            <AdminNav />
            <div className="container mt-5">
                {!loading && ownerRecords.length > 0 && (
                    <DataTable
                        title="Owner Contact Details"
                        columns={columns}
                        data={ownerRecords}
                        fixedHeader
                        pagination
                    />
                )}
            </div>
        </div>
    );
}

export default OwnerContacts;
